import React from 'react';

const Certifications = () => {
  return (
    <section id="certifications" className="section">
      <h2>Certifications</h2>
      <ul>
        <li><a href="https://certificates.ccbp.in/intensive/static-website?id=HAZOEXVAIR" target="_blank" rel="noreferrer">Static Website</a></li>
        <li><a href="https://certificates.ccbp.in/intensive/responsive-website?id=MBULYAMIHB" target="_blank" rel="noreferrer">Responsive Website</a></li>
        <li><a href="https://certificates.ccbp.in/intensive/programming-foundations?id=PRACNTAIEJ" target="_blank" rel="noreferrer">Programming Foundations</a></li>
        <li><a href="https://certificates.ccbp.in/intensive/introduction-to-databases?id=ROTVJLOMBP" target="_blank" rel="noreferrer">Introduction to Databases</a></li>
        <li><a href="https://certificates.ccbp.in/intensive/developer-foundations?id=UYUYACNEXY" target="_blank" rel="noreferrer">Developer Foundations</a></li>
        <li><a href="https://certificates.ccbp.in/intensive/dynamic-web-application?id=YZDCPHHJHQ" target="_blank" rel="noreferrer">Dynamic Web Application</a></li>
        <li><a href="https://certificates.ccbp.in/intensive/javascript-essentials?id=QXXMTWSSHJ" target="_blank" rel="noreferrer">JavaScript Essentials</a></li>
        <li><a href="https://certificates.ccbp.in/intensive/flexbox?id=XWRZUPNUIU" target="_blank" rel="noreferrer">Flexbox</a></li>
        <li><a href="https://certificates.ccbp.in/intensive/node-js?id=RIANSSHKQE" target="_blank" rel="noreferrer">Node.js</a></li>
        <li><a href="https://certificates.ccbp.in/intensive/react-js?id=GMNRJEEXUD" target="_blank" rel="noreferrer">React.js</a></li>
      </ul>
    </section>
  );
};

export default Certifications;
